let parse_error_rich =
    Some (fun (ctxt: ParseErrorContext<_>) ->
        let pos =
            try Some (ctxt.ParseState.InputStartPosition(1))
            with _ -> None

        match pos with
        | Some pos -> reportParseErrorAt(pos.Line + 1, pos.Column + 1, ctxt.Message)
        | None -> reportParseError ctxt.Message)


